An evaluator defined in a module or imported from a different module can be invoked via the enf keyword. For example (public inputs and boundary constraints omitted for brevity): trace_columns { main: [a, b]
} integrity_constraints { enf foo([a, b])
} ev foo([x, y]) { enf x' = x + y
