Frequently, we may want to enforce constraints based on some selectors. For example, let's say our trace has 4 columns: a, b, c, and s, and we want to enforce that c′=a+b when s=1 and c′=a⋅c when s=0. We can write these constraints directly like so: trace_columns { main: [a, b, c, s]
} integrity_constraints { enf s^2 = s enf c' = s * (a + b) + (1 - s) * (a * b)
} Notice that we also need to enforce s2=s to ensure that column s can contain only binary values. While the above approach works, it gets more and more difficult to manage as selectors and constraints get more complicated. To simplify describing constraints for this use case, AirScript introduces enf match statement. The above constraints can be described using enf match statement as follows: trace_columns { main: [a, b, c, s]
} integrity_constraints { enf s^2 = s enf match { case s: c' = a + b case !s: c' = a * c }
} In the above, the syntax of each "option" is case <selector expression>: <constraint>, where selector expression consists of values composed using binary operands and logical operators !, &, and |. AirScript reduces logical operations to their equivalent algebraic operations as follows: !a reduces to 1−a. a & b reduces to a⋅b. a | b reduces to a+b−a⋅b. The example below illustrates how these operators can be used to build more complex selectors: trace_columns { main: [a, b, c, s0, s1]
} integrity_constraints { enf s0^2 = s0 enf s1^2 = s1 enf match { case s0 & s1: c' = a + b case s0 & !s1: c' = a * c case !s0 & s1: c' = a - b case !s0 & !s1: c' = c }
} AirScript makes the following assumptions about selector expressions, which are not yet enforced by the language: All selector expressions are based on binary values. To enforce these, we must manually add constraints of the form x2=x for all values involved in selector expressions. All selector expressions are mutually exclusive. That is, for a given set of inputs, only one of the selector expressions in an enf match statement can evaluate to 1, and all other selectors must evaluate to 0. Note: it is OK if all selector expressions evaluate to 0.

