In addition to applying selectors to individual constraints, we can apply them to evaluators . For example: trace_columns { main: [a, b, c, s]
} integrity_constraints { enf s^2 = s enf match { case s: foo([a, b, c]) case !s: bar([a, b, c]) }
} ev foo([a, b, c]) { enf c' = a + b
} ev bar([a, b, c]) { enf c' = a * b
} The above is equivalent to the first example in this section. However, the real power of combining evaluators and conditional constraints comes from two aspects: Evaluators can be imported from other modules. Thus, the logic of defining constraints, and then selecting which one is applied in a given case can be cleanly separated. Evaluators can contain multiple constraints. In such cases, selector expressions would be applied to all constraints of an evaluator. The example below illustrates the latter point. trace_columns { main: [a, b, c, s]
} integrity_constraints { enf s^2 = s enf match { case s: foo([a, b, c]) case !s: bar([a, b, c]) }
} ev foo([a, b, c]) { enf a' = a * 2 enf b' = b + 1 enf c' = a + b
} ev bar([a, b, c]) { enf a' = a + 1 enf b' = b * 3 enf c' = a * b
}

